import React, {Component, Fragment} from 'react';
import '../../statics/style/newsong.css';

class NewSong extends Component{
    constructor(props) {
        super(props);
    }

    render(){
        return(
            <div className="newsongItem outside">
                {this.props.newsongList.map((value, index)=>{
                    console.log('lbt', value)
                    console.log('lbt index', index)
                    return(
                        <Fragment>
                           <span>{value.id}</span>
                           <div className="newsongItem-info">{value.name}</div>
                           <div className="newsongItem-avatar">
                               <img src={value.imageUrl}/>
                           </div>
                           <div className="newsongItem-processbar"></div>
                        </Fragment>
                    )
                })}
            </div>
        )
    }
}

export default NewSong;
